const Box = ({ rowNum, boxNum, boxData }) => {
  const boxColor = rowNum % 2 === 0 && boxNum % 2 === 0 ? "black" : "white";
  return (
    <div className={`box-${boxColor}`}>
      box {boxColor} {boxNum}
    </div>
  );
};

export default Box;
